import React from 'react';
import { Link } from 'react-router-dom'
import { Button } from 'react-bootstrap';

import classes from './AddInterview.module.css';

const AddInterview = (props) => {
    const ButtonClickHandler = (event) => {
        event.preventDefault();
        if(props.setIsHome(false));
    }

    return (
        <React.Fragment>
            <Link to="/createInterview">
                <Button className={classes.addInterviewButton} onClick={ButtonClickHandler}>Create Interview</Button>
            </Link>
        </React.Fragment>
    );
};

export default AddInterview;
